app.controller("quescreen-cont",["$scope","$location","$http",function(a,c,b){a.sendok=function(){a.answer=1;b.get("/services/answers/"+a.params.gameId+"/"+a.params.queId+"/"+a.answer).then(function(d){a.respond=d.data})};a.sendno=function(){a.answer=0;b.get("/services/answers/"+a.params.gameId+"/"+a.params.queId+"/"+a.answer).then(function(d){a.respond=d.data})};a.$on("$locationChangeStart",function(d){b.get("/services/back/"+a.gameid+"/"+a.numin)})}]);